import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {App, Left, Right} from './App';
import reportWebVitals from './reportWebVitals';
let app = (
    <div>
    <div className="title">
    <section className="table">
    <App name = "left_title" id = "home" path = "#Home" content = "Home"/>
    <App name = "left_title" id = "aboutme" path = "#About Me" content = "About Me"/>
    <App name = "left_title" id="nan" path = "#Contact Me" content = "Contact Me"/>
    <App name = "right_title" id="login" path = "#Login" content = "Login"/>
    </section>
    </div>
        <div className="content">
            <div className="left_side">
                <h1>This is my blog</h1>
                <Left id = "Blog_post_#1" className = "inner_table" classname = "inner_text" post = "1" order = "first" number = "1" author = "israel" text = {<span id="firstBlog">and how to write a new
                    post in my<br/>blog,
                    you find it <a href='#here'>here</a></span>}/>
                <br/>
                <Left id = "Blog_post_#2" className = "inner_table" classname = "inner_text" post = "2" order = "second" number = "2" author = "Joe" text = ""/>
                <br/>
                <Left id = "Blog_post_#3" className = "inner_table" classname = "inner_text" post = "3" order = "third" number = "3" author = "israel" text = ""/>
            </div>
            <div className="right_side">
                <Right className = "up" title = "Latest" number1 = "1" first = "1" number2 = "2" second = "2" number3 = "3" third = "3" />
                <Right className = "down" title = "Popular" number1 = "3" first = "3" number2 = "1" second = "1" number3 = "2" third = "2" />

            </div>
        </div>
    </div>
);


ReactDOM.render(
    app,
  document.getElementById('root1')
);


// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
